import React from "react";
import maidenlessBrothers from "../../Images/team/maidenlessBrothers.png";

export function TeamDisplay()
{
    return (    
                <div class="container">
                    <img src={maidenlessBrothers} alt="Four cats named Stella, Sam, Darien, and Adamari proclaiming they are the Maidenless Brothers"/>
                    Under Construction!
                </div>
            )
}
